import styled from 'styled-components';

export const Name = styled.span`
  font-size: 30px;
`;

export const ResultWrapper = styled.div`
  padding: 20px;
  background-color: white;
  width: 35%;
  margin: 0 auto;
  margin-bottom: 20px;
  border-radius: 10px;
  color: grey;
  display: flex;
  justify-content: center;

  :hover {
    background-color: #3f0f3f;
    color: white;
    cursor: pointer;
  }
`;

export const Slack = styled.span`
  margin-left: 20px;

`
